import React from "react";
import Us from "../assets/sexy.jpg";
import "../styles/About.css";

function About() {
  return (
    <div className="about">
      <div className="aboutTop" style={{ backgroundImage: `url(${Us})` }}></div>

      <div className="aboutBottom">
        <h1>About Us</h1>
        <p>
          GMora Thrift X Bart Sabbath: Born in 2022 from a hobby shared by two
          friends. Affordable vintage finds, no frills. It's a chaotic, fun ride
          through fashion. Join us!
        </p>
      </div>
    </div>
  );
}

export default About;
